import React, { Component } from "react";
import "../Styles/App.css";

class CardList extends Component {

  render() {
    return (
        <div class="card text-center">

            <h3 className="card-title">{this.props.course} {this.props.name}</h3>
            <h4>{this.props.d}</h4>
        </div>
    );
  }
}
